import React from 'react'
import ob from './OrderPage.module.css'
import Header from '../Header/Header'
import Map from './img/map.jpg';
import { NavLink } from 'react-router-dom'
import { ReactSearchAutocomplete } from 'react-search-autocomplete'

const OrderPage = () => {

  const items = [
    {
      id: 0,
      name: 'Cobol'
    },
    {
      id: 1,
      name: 'JavaScript'
    },
    {
      id: 2,
      name: 'Basic'
    },
    {
      id: 3,
      name: 'PHP'
    },
    {
      id: 4,
      name: 'Java'
    }
  ]

  const handleOnSearch = (string, results) => {
    // onSearch will have as the first callback parameter
    // the string searched and for the second the results.
    console.log(string, results)
  }

  const handleOnHover = (result) => {
    // the item hovered
    console.log(result)
  }

  const handleOnSelect = (item) => {
    // the item selected
    console.log(item)
  }

  const handleOnFocus = () => {
    console.log('Focused')
  }

  return (
    <div className={ob.content}>
      <Header />
      <div></div>

      <div className={ob.navbar}>
        <div className={ob.navbar_elements}>
          <div>
            <NavLink to='/carsharing/orderpage/location' className={ob.nav_element} activeClassName={ob.nav_element_active}>Местоположение</NavLink>
            <div className={ob.arrow}></div>
            <NavLink to='/carsharing/orderpage/model' className={ob.nav_element} activeClassName={ob.nav_element_active}>Модель</NavLink>
            <div className={ob.arrow}></div>
            <NavLink to='/carsharing/orderpage/additionally' className={ob.nav_element} activeClassName={ob.nav_element_active}>Дополнительно</NavLink>
            <div className={ob.arrow}></div>
            <NavLink to='/carsharing/orderpage/total' className={ob.nav_element} activeClassName={ob.nav_element_active}>Итого</NavLink>
          </div>
        </div>
      </div>


      <div className={ob.body}>
        <div className={ob.body_content}>
          <div className={ob.geolocation}>
            <div className={ob.select_adress}>
              <div className={ob.texts_adress}>
                <p>Город</p>
                <p>Пункт выдачи</p>
              </div>
              <div className={ob.selectors_adress}>
                <div style={{ width: 300 }}>
                  <ReactSearchAutocomplete
                    items={items}
                    onSearch={handleOnSearch}
                    onHover={handleOnHover}
                    onSelect={handleOnSelect}
                    onFocus={handleOnFocus}
                    showIcon={false}
                    styling={{borderRadius: "0px",
                      
                      fontSize: "11px",
                      height: "21px",
                      fontFamily: "Roboto",
                      fontWeight: 300}}
                    autoFocus
                  />
                </div>
                <select name="user_pickpoint" required="required">
                  <option value="">Начните вводить пункт ...</option>
                  <option value="1">Ломоносова 2А</option>
                  <option value="2">Пушкина 11</option>
                  <option value="3">Советская 21</option>
                </select>
              </div>
            </div>
            <div className={ob.map}>
              <p>Выбрать на карте:</p>
              <img src={Map} alt="" />
            </div>
          </div>
          <div className={ob.description}></div>
        </div>
      </div>
    </div>
  )
}

export default OrderPage;
